import './App.css';
import React from 'react';
import Navbar from './Components/Navbar';
import Home from './Components/Home';
import About from './Components/About';
import Shop from './Components/Shop';


function App() {
  return (
    <>
    <header>
    <Navbar />
    </header>

    <Home />
    <About />
    <Shop />
    </>
  );
}



export default App;
